import styled from 'styled-components';

export const App = styled.div`
    height: 100%;
    margin-top: 0px;
    display: auto;
    justify-content: center;
    align-items: center;
`;

export const Container = styled.div`
    height: 100%;
    margin-top: 1%;
    display: flex;
    justify-content: center;
    align-items: center;
`;

export const Content = styled.div`
    width: 700px;
    height: 100%;
    margin: auto;
    background: #fff;
    border-radius: 10px;
    box-shadow: 20px 20px 0px rgba(0, 0, 0, 0.1);
    padding: 30px;
    
`;
